docs/json.html.body:
Create a JSON language
The files must be defined in the path folder in init() method. The file name must be the identifier defined in the method init(). If possible, use the same name as the identifier of the browser (navigator.language)
Example : languages/fr_FR.json, languages/en_EN.json, languages/en_US.json, etc.
JSON file must have the following format:
[{
    "ID": "text"
},
{
    "config": {}
}]

The first entry in the table contains the identifiers with texts. The second contains the configuration values ​​as the plural.
Example :
[
  {
    "hello": "hello"
  },
  {

  }
]

With the above example, in the code, "hello".t() returns Hello (with a capital letter)

docs/plurial.html.body:
Plurial
The plural is defined in the JSON with the plurial key. Consider an example :
[{
    "you have nb message": "you have %d message%p"
},
{
    "plurial": {
            "p": ["s"]
      }
}]

Here, the %dparameter specifies an integer number is expected for you have nb message id. %p indicates that the plural of the term is used. The plural will be based on the value of %d. In plurial parameter, we define a rule. For %p in the plural, the letter s is added at the end.
The result will be :
let nbMsg = 1;
'you have nb message'.t(nbMsg); // You have 1 message

nbMsg = 2;
'you have nb message'.t(nbMsg); // You have 2 messages

Plural feature
It may be that the plural is different depending on a word. You can set it like this:
[{
    "you have nb accessory": "you have %d accessor%p1"
},
{
    "plurial": {
      "p": ["s"],
      "p1": ["ies", "y"]
      }
}]

Here, we define a new rule of plural.
The result will be :
let nb = 1;
'you have nb accessory'.t(nb); // You have 1 accessory

nb = 2;
'you have nb accessory'.t(nb); // You have 2 accessories

Thus, the table is defined as follows:
"p[0-9]+": [plurial, singular, duel, triel, ...]
Parameters
In a string, you can add parameters :
[{
    "you name is": "you name is %s, you're %d"
},
{
    "plurial": {
      "p": ["s"]
      }
}]

The code will :
  'you name is'.t('Sam', 21);

Parameters are :

%s : string
%d : decimal
%p : indicates a plural (see above)

docs/pattern.html.body:
Pattern
If a word is found several times, it is not useful to rewrite it more times. In this case, we use the re-use of a word with curly braces
[{
    "remember": "remember",
    "remember me": "{1} me"
},
{
    "plurial": {
            "p": ["s"]
      }
}]

 The 1 between brace allows to recover remember located in first position in the key.
 It is possible to use the parameters :
 [{
     "your": "your",
     "message": "message%p",
     "your nb message": "{1} %d {3} !"
 },
 {
     "plurial": {
             "p": ["s"]
       }
 }]

 In Js :
 'your nb message'.t(2); // Your 2 messages

docs/group.html.body:
Group
You can group translations in the JSON :
[{
    "you have nb $objects": "you have %d {4}",
    "$objects": {
        "image": "image%p",
        "file": "file%p",
        "message": "message%p"
    }
},
{
    "plurial": {
            "p": ["s"]
      }
}]

A group starts with a $. Here, the name is $objects. It contains 3 words that can be in the plural.Thus, we can make 3 combinations:

you have %d image%p
you have %d file%p
you have %d message%p

In Js :
'you have nb image'.t(1); // You have 1 image
'you have nb file'.t(2); // You have 2 files
'you have nb message'.t(3); // You have 3 messages

You can also use only the word present in the group
'image'.t(1); // Image
'file'.t(2); // Files
'message'.t(3); // Messages

Combining groups
[{
    "$verbs": {
      "add": "add",
      "remove": "remove"
    },
    "$objects": {
        "image": "image%p",
        "file": "file%p"
    },
    "$verbs $objects": "{1} {2}"
},
{
    "plurial": {
            "p": ["s"]
      }
}]

In JS :
'add image'.t(); // Add image
'remove image'.t(); // Remove image
'add file'.t(); // Add file
'remove file'.t(2); // Remove files

docs/condition.html.body:
Conditional value
Here's the JSON :
[{
  "$you": {
    "you have": "you have"
  },
  "$you nb message": "{1} %d message%p",
  "$you no message": "{1} no message"
},
{
    "plurial": {
            "p": ["s"]
      }
}]

You can use a condition to display one's self according to the value of a boolean :
let nbMsg = 3
'you have nb message | you have no message'.t(nbMsg>0, nbMsg) // You have 3 messages

nbMsg = 0
'you have nb message | you have no message'.t(nbMsg>0, nbMsg) // You have no message

If the parameter is true, it will take the first identifier (separated by |). Otherwise, it takes the second.
The above expression plus being simplified:
let nbMsg = 3
'you have (nb message | no message)'.t(nbMsg>0, nbMsg) // You have 3 messages

docs/add.html.body:
concatenate messages
It is possible to concatenate messages
Here's the JSON :
[{
  "you have": "you have",
  "message": "%d message%p"
},
{
    "plurial": {
            "p": ["s"]
      }
}]

In JS :
'you have + message'.t(2) // You have 2 messages

Use the + symbol to concatenate two messages

Warning, this method can be useful but blocking for the translation of other languages. If the form of the sentence is different in another language, it will be difficult to use this method

docs/namespace.html.body:
Namespaces
It is possible that you need to create a plugin using its own translation. In this case, you can use the namespaces
// Initialize Language
Languages.init('fr_FR', 'core/languages/', () => {
    'hello'.t()
});

// Add namespace
Languages.add('fr_FR', 'plugins/my_plugin/languages/', 'plugin_name', () => {
    'plugin_name.hello'.t()
});

Use the add() method and add the plugin name (namespace)

docs/packages.html.body:
Using an object directly
Instead of searching the JSON in a file, you can directly assign objects with the packages() method. You then set the default language with default()
Browser
const fr_FR = [
  {
    "hello": "bonjour"
  },
  {}
]
const en_EN =  [
  {
    "hello": "hello"
  },
  {}
]

Languages.packages({ fr_FR, en_EN }).default('en_EN')
'hello'.t() // 'Hello'

NodeJS
With NodeJS, you can recover the JSON with require()
const fr_FR = require('./languages/fr_FR.json')
const en_EN = require('./languages/en_EN.json')

Languages.packages({ fr_FR, en_EN }).default('en_EN')

docs/set.html.body:
Change the language
You can change the language with the set() method. Think, however, of initializing languages :
Languages.init(['en_EN', 'fr_FR'], 'languages/', () => {
    'hello'.t() // Hello
  Languages.set('fr_FR', () => {
    'hello'.t() // Bonjour
  });
});

With packages
const fr_FR = [
  {
    "hello": "bonjour"
  },
  {}
]
const en_EN =  [
  {
    "hello": "hello"
  },
  {}
]

Languages.packages({ fr_FR, en_EN }).default('en_EN')
'hello'.t() // 'Hello'
Languages.set('fr_FR')
'hello'.t() // 'Bonjour'

docs/angularjs.html.body:
AngularJS 1

Add module to application :

var app = angular.module('app', ['Languages'])


Initialize the language in the config method

Languages.init('fr_FR', './languages/', () => {
  angular.bootstrap(document, ['app']);
});


Using filters in templates :

{{'hello' | t}}

You can use the settings :
{{'you have nb message' | t:2}}

Use service
You can access Language with Injection Dependency :
app.controller('MyController', function(Languages) {
  Languages.translate('hello');
})

docs/handlebars.html.body:
Handlebars
Browser
Use directly in a template :

  {{t "hello"}}


Languages.init('fr_FR', './languages/', () => {
  var source   = $("#entry-template").html();
  var template = Handlebars.compile(source)
})

NodeJS
With Express-hbs module :
const hbs = require('express-hbs')
const Languages = require("languages-js")

Languages.init('fr_FR', './languages/') // sync
Languages.load.Handlebars(hbs)

Use settings
Example 1 :
{{t "NB_MSG" nb=2}}

Example 2 :
{{t "you have (nb message | no message)" nb=1 if=true}}
